import connect from "./connect";

const registerUser = (
  stompClient,
  setUserData,
  userData,
  privateChats,
  setPrivateChats,
  publicChats,
  setPublicChats) => {   
  connect(stompClient, 
    setUserData,
    userData,
    privateChats,
    setPrivateChats,
    publicChats,
    setPublicChats);
};

export default registerUser;
